import { ReactNode } from "react";
import { Container } from "@mui/material";

interface ConatainerProps {
  children: ReactNode;
}

export default function BasicContainer(props: ConatainerProps) {
  const {children} = props;
  return (
    <Container sx={{
      height: '100vh',
      width: '100vw',
      padding: '0',
      marginTop: '10vh',
      margin: '0',
      overflow: 'hidden',
    }}>
      {children}
    </Container>
  )
}
